import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export const ClintCards = () => {
  return (
    <div>
      <h2> Clint List <Badge bg="secondary">3</Badge></h2>
      <p> View,add,edit and delet your clints details</p> <Nav.Link eventKey="link-2">Learn More</Nav.Link>
     <Card>
      <Card.Body>
        <Card.Title> Setup your Outlet Control profile for clints to book online</Card.Title>
            <Card.Text>
              Free up time and get your clints self booking online 24/7.
            </Card.Text>
              <Button variant="primary">Start</Button>   
        </Card.Body>
     </Card>
    </div>
  )
}
